    [MethodImpl(MethodImplOptions.AggressiveInlining)]
    private static byte I(uint X) => LOBYTE(LOWORD(Crc32Table[X]));

    public static byte[] rCRC(uint targetCrc, uint originalCrc)
    {
        targetCrc ^= 0xFFFFFFFF;
        originalCrc ^= 0xFFFFFFFF;
        
        byte W = HIBYTE(HIWORD(targetCrc));
        byte X = LOBYTE(HIWORD(targetCrc));
        byte Y = HIBYTE(LOWORD(targetCrc));
        byte Z = LOBYTE(LOWORD(targetCrc));
        
        byte A = HIBYTE(HIWORD(originalCrc));
        byte B = LOBYTE(HIWORD(originalCrc));
        byte C = HIBYTE(LOWORD(originalCrc));
        byte D = LOBYTE(LOWORD(originalCrc));

        byte p = RF(W);
        byte o = RF((byte)(X ^ G(p)));
        byte n = RF((byte)(Y ^ G(o) ^ H(p)));
        byte m = RF((byte)(Z ^ G(n) ^ H(o) ^ I(p)));

        byte d = (byte)(m ^ D);
        byte c = (byte)(n ^ C ^ I(m));
        byte b = (byte)(o ^ B ^ H(m) ^ I(n));
        byte a = (byte)(p ^ A ^ G(m) ^ H(n) ^ I(o));

        return new byte[] { d, c, b, a };
    }
    
    public static uint CalculateCRC32(ReadOnlySpan<byte> data, uint initialCrc = 0)
    {
        uint crc = ~initialCrc;
        var len = data.Length;
        var p = 0;
        for (; len >= 16; len -= 16)
        {
            uint num4 = FastTable[768  + data[p + 12]] ^ FastTable[512  + data[p + 13]] ^ FastTable[256  + data[p + 14]] ^ FastTable[       data[p + 15]];
            uint num3 = FastTable[1792 + data[p + 8 ]] ^ FastTable[1536 + data[p + 9 ]] ^ FastTable[1280 + data[p + 10]] ^ FastTable[1024 + data[p + 11]];
            uint num2 = FastTable[2816 + data[p + 4 ]] ^ FastTable[2560 + data[p + 5 ]] ^ FastTable[2304 + data[p + 6 ]] ^ FastTable[2048 + data[p + 7 ]];
            uint num1 = FastTable[3840 + (((int) crc ^ data[p]) & 0xFF)] ^ 
                        FastTable[3584 + (((int) (crc >> 8) ^ data[p + 1]) & 0xFF)] ^ 
                        FastTable[3328 + (((int) (crc >> 16) ^ data[p + 2]) & 0xFF)] ^ 
                        FastTable[3072 + (((int) (crc >> 24) ^ data[p + 3]) & 0xFF)];

            crc = num1 ^ num2 ^ num3 ^ num4;
            p += 16;
        }
        while (--len >= 0)
        {
            crc = FastTable[(crc ^ data[p++]) & 0xFF] ^ crc >> 8;
        }
        return ~crc;
    }
}